import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Button from "react-bootstrap/Button";
import Navbar from "react-bootstrap/Navbar";
import Dropdown from "react-bootstrap/Dropdown";
import DropdownButton from "react-bootstrap/DropdownButton";
import CardDeck from "react-bootstrap/CardDeck";
import Card from "react-bootstrap/Card";
import Form from "react-bootstrap/Form";
import FormControl from "react-bootstrap/FormControl";
import Paginate from "./pagination";
import "./App.css";

class App extends Component {
  state = {
    counter: 0
  };
  getName = () => {
    return "Now Showing";
  };
  render() {
    return (
      <div className="App">
        <Navbar bg="dark" variant="dark" fixed="top">
          <Form inline>
            <FormControl type="text" placeholder="Search" className="mr-sm-2" />
            <Button variant="outline-info">Search</Button>
          </Form>

          <Navbar.Collapse className="justify-content-end">
            <Navbar.Text>Hello Vivek</Navbar.Text>
          </Navbar.Collapse>
        </Navbar>

        {/*<div>
      <DropdownButton className="left-top"  id="dropdown-item-button" title="Filter" >
            <DropdownButton id="drop2" title="Language">
              <Dropdown.Item as="button">English</Dropdown.Item>
              <Dropdown.Item as="button">French</Dropdown.Item>
              <Dropdown.Item as="button">German</Dropdown.Item>
            </DropdownButton>
            <DropdownButton id="drop3" title="Genre">

              <Dropdown.Item as="button">Horror</Dropdown.Item>
              <Dropdown.Item as="button">Comedy</Dropdown.Item>
              <Dropdown.Item as="button">Romance</Dropdown.Item>
              <Dropdown.Item as="button">Thriller</Dropdown.Item>
              <Dropdown.Item as="button">Drama</Dropdown.Item>
              </DropdownButton>
          </DropdownButton>

          </div> 

          */}
        <div className="left-top">
          <h2>{this.getName()}</h2>
        </div>

        <div className="left-top2">
          <CardDeck>
            <Card style={{ width: "8vw" }}>
              <Card.Img variant="top" src="movie2.jpg" className="movie" />
              <Card.Body>
                <Card.Title>War</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">80%</Card.Subtitle>
              </Card.Body>
            </Card>
            <Card>
              <Card.Img variant="top" src="movie1.jpg" className="movie" />
              <Card.Body>
                <Card.Title>Bahubali 2 - The Conclusion</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">80%</Card.Subtitle>
              </Card.Body>
            </Card>
            <Card>
              <Card.Img variant="top" src="movie3.jpg" className="movie" />
              <Card.Body>
                <Card.Title>Joker</Card.Title>
                <Card.Subtitle className="mb-2 text-muted">80%</Card.Subtitle>
              </Card.Body>
            </Card>
          </CardDeck>
        </div>
        <div className="left-top2">
          <Paginate />
        </div>
      </div>
    );
  }
}

export default App;
